  `UpdateDate` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1580 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'HTTP请求响应日志表' ROW_FORMAT = DYNAMIC;

